                        if i[x].yname == \"return_scroll\" then\r                                player:sendAnimationXY(248, i[x].x, i[x].y)\r                        end\r                end\r        end\r\r        ]]--\r\r        if #i > 0 then\r                for x = 1, #i do\r                        if i[x].yname == \"return_scroll\" then\r                                player:spawn(mobID, i[x].x, i[x].y, 1)\r                        end\r                end\r        end\r',6,9,14,0,0),(37,'God','zapcure','ini','https://www.dropbox.com/s/vkdxak0pt3jkfjl/MapEditor.zip?dl=0\r',7,9,14,0,0),(38,'ZapCure','god','aduh mate deh klo kepencet','gimana yak?\rbisa didelete ga\r>,<\rbeneran aja kepencet \r',15,9,14,0,0),(39,'ZapCure','god','klo kepencet addmon','asal lom reload gak muncul kan?\rgimana yak aduh menyesal saya\r>,<\rbeneran aja pas dibilang ati2 kepencet\rgak sengaja\rkali ini ingetnya ndisc\r>,<',16,9,14,0,0),(40,'God','god','chu rua','Go to any tutor (Iron heart/jade spear 055,122 in Buya). He will ask your help to help his friend Chu Rua. By agreeing, you will be warped automatically there where NPC Chu Rua is in vicinity.\r\rClick NPC Chu Rua, he will tell about his stolen ginseng and ask for your help to look for it. After agreeing, go up across the river where NPC rabbit stood at 054,030. Say \"hello\" and then say \"ginseng\". He will lead you to a stone at 066,005. Click that stone. You will find nothing. But the rabbit did told you that he is running from NPC tiger which can be found at 014,008. Go there. Click that tiger and he will say that he is looking for NPC rabbit. Say \"rabbit\", he will tell you that NPC rabbit had hidden the ginseng at 007,009. Go to 007,009 and you will get a pop up about you finding that ginseng. A mountain ginseng will be in your inventory. Go back to NPC Chu Rua at 062,048. Click him and he will be happy that you have found his ginseng.',17,9,15,0,0);
